const initialState = [
    {
        title: "Aprovados",
        id: 0,
        card: [
            {
                id: 0,
                text: "card 0"
            },
            {
                id: 1,
                text: "card 1"
            }

        ]
    }
];

const listsReducer = (state = initialState, action) => {
    switch(action.type) {
        default:
            return state;
    }
}

export default listsReducer;
